import React from "react";

const Logo = () => {
  const mainDiv = {
    width: "100%",
    flexShrink: "1",
    display: "flex",
    flexFlow: "column nowrap",
    justifyContent: "flex-end",
    transition: "transform .75s cubic-bezier(.19,1,.22,1)",
    height: "172px",
  };
  const secDiv = {
    maxHeight: "172px",
    paddingBottom: "20px",
    width: "100%",
  };
  const logo = {
    font: "0/0 a",
    color: "transparent",
    textShadow: "none",
    backgroundColor: "transparent",
    border: "0",
    height: "100%",
    width: "100%",
    // backgroundImage: "url(../asset/logo.png)",
    backgroundSize: "contain",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "50% 50%",
  };
  return (
    <div style={mainDiv}>
      <div style={secDiv}>
        <div style={logo}>M room</div>
      </div>
    </div>
  );
};
export default Logo;
